main() {
  // Challenge 1
  // Print first 30 terms of Fibonnaci sequence
  // Fibonnaci sequence is generated by adding last two terms, here are first six terms for you
  // 1, 1, 2, 3, 5, 8
  int fibonacci(int n) => n <= 2 ? 1 : fibonacci(n - 2) + fibonacci (n - 1);
  String output = "";
  for (int i = 1; i <= 30; ++i) {
    output += fibonacci(i).toString() + ", ";
  }
  print(output);
}
